enum EnumAppActionType {
    initializedSuccess = 'APP/INITIALIZED-SUCCESS'
}

const initialState = {
    initialized: false
}


export const AppReducer = (state: InitialStateType = initialState, action: AppActionType) => {
    switch (action.type) {
        case EnumAppActionType.initializedSuccess:
            return {...state, initialized: true}
        default:
            return {...state}
    }
}

const initializedSuccess = () => {
    return {type: EnumAppActionType.initializedSuccess}
}
type InitialStateType = typeof initialState
export type AppActionType = ReturnType<typeof initializedSuccess>
